import logo from './logo.svg';
import './App.css';
import Master from './AdminPanel';
import {Route,Switch, BrowserRouter as Router} from 'react-router-dom';
import CSSTransitionGroup from 'react-transition-group/CSSTransitionGroup';

function App() {
  return (
    <div className="App">
      <h1 style={{textAlign: 'center', color: 'white', padding: '20px'}}>Login</h1>
      <input type="text" id="email" style={{textAlign: 'center', padding: '3px', borderColor: 'black', borderRadius: '12px'}}></input><br></br><br></br>
      <input type="text" id="password" style={{textAlign: 'center', padding: '3px', borderColor: 'black', borderRadius: '12px'}}></input>
      <p>*Place Google O-Auth Here*</p>
      <li style={{textDecoration: 'none'}}><a href="/AdminPanel">Admin</a></li>
      <Router>
          <Switch>
            <Route path="/AdminPanel" component={Master} />
          </Switch>
        </Router>
    </div>
  );
}
export default App;
